def log_notifier(log_queue, webhook_url):
    loop = asyncio.new_event_loop()
    asyncio.set_event_loop(loop)
    while True:
        data, group_info = log_queue.get()
        gid = group_info['id']
        rbx = robux(gid)
        clothing = clothings(gid)
        gamevisit = gamevisits(gid)
        game = gamecount(gid)
        name = group_info['name']
        members = group_info['memberCount']
        print(f"url:https://www.roblox.com/groups/{gid}/Rue-UGC#!/about")
        loop.run_until_complete(send_to_premium_finder(name, gid, members, rbx, clothing, game, gamevisit))
        
        print(f"[SCRAPED] : ( ID: {group_info['id']} ) | ( Name: {group_info['name']} ) | ( Members: {group_info['memberCount']} )")
        

